window.bookSummaryJSON = "<p>After failing to catch up with her daughter Jelena so many times, Alisa's optimism is battered, but her determination has never waned. She, Leonidas, and their eclectic crew are hunting down a Starseer research station in the heart of the Kir Asteroid belt - Jelena's supposed location. Alisa vows that she will find her daughter if she has to search a million asteroids to do so. </p> <p>But Jelena and her close friend, Prince Thorian, have attracted the interest of many factions, and the Star Nomad isn't the only ship on the hunt.... </p>"; 
